INSERT INTO `nahual` VALUES (1,'B\'atz - Mono','0001-01-01','0001-01-01','./src/gui/nahuales/1 batz.jpg','HILO, EL D├ìA DEL PRINCIPIO DE LA ENERG├ìA, DEL TIEMPO Y DEL ESPACIO.','Es el Nawal de todas las artes, de los tejidos, de los artistas. Es un d├¡a propicio para pedir pareja, amarrar o desatar cualquier asunto. Son maestros de todas las artes.'),(2,'E - Camino','0001-01-01','0001-01-01','./src/gui/nahuales/2 e.jpg','CAMINO, EL D├ìA DEL CAMINO SAGRADO, EL D├ìA DE LA ACCI├ôN.','Es el Nawal de todos los caminos y dirigentes. Del sistema nervioso y sangu├¡neo. D├¡a propicio para iniciar cualquier viaje o negocio. Son l├¡deres naturales.'),(3,'Aj ÔÇô Hogar','0001-01-01','0001-01-01','./src/gui/nahuales/3 aj.jpg','CA├æA Y MILPA ES El D├ìA DE LA ABUNDANCIA Y LA MULTIPLICACI├ôN.','Es el Nawal de la casa y de los ni├▒os, d├¡a propicio para el hogar y la salud de los ni├▒os.	Nawal de las generaciones tiernas.	Personas que no pueden negarse ante otros.'),(4,'I\'x ÔÇô Madre Tierra','0001-01-01','0001-01-01','./src/gui/nahuales/4 ix.jpg','MUJER Y JAGUAR, EL DIA DE LA MADRE TIERRA, LA MADRE NATURALEZA Y LA LUNA.','Es el Nawal de la naturaleza y los altares mayas, d├¡a para pedir fortaleza f├¡sica y mental. Es el Nawal de las siete verg├╝enzas humanas: orgullo, ambici├│n, envidia, mentira, crimen, ingratitud, ignorancia por pereza. Personas de razonamiento interno a las que les gusta la naturaleza y la soledad.'),(5,'Tz\'ikin - P├íjaro','0001-01-01','0001-01-01','./src/gui/nahuales/5 tzikin.jpg','AGUILA, El D├ìA DE LA RIQUEZA Y LA BUENA FORTUNA, EL D├ìA DE LA VISI├ôN.','Es el Nawal del bienestar econ├│mico, la buena fortuna, d├¡a propicio para agradecer y pedir el bienestar econ├│mico. Es la comunicaci├│n e intermediaci├│n entre Uk┬┤ux Kaj y Uk┬┤ux Ulew, el coraz├│n del cielo y el coraz├│n de la tierra. Personas que construyen su propio bienestar.'),(6,'Ajmaq ÔÇô Pecador','0001-01-01','0001-01-01','./src/gui/nahuales/6 ajmaq.jpg','PECADO, ES EL D├ìA PARA DAR Y PEDIR PERD├ôN POR TODOS LOS PECADOS ANTE EL AJAW.','Es el Nawal de todas las faltas, es el d├¡a de los abuelos que ya no est├ín (difuntos). Es el d├¡a para pedir perd├│n por las faltas. Personas valientes y de sangre dulce que  f├ícilmente caen en culpas.'),(7,'No\'j ÔÇô Sabidur├¡a','0001-01-01','0001-01-01','./src/gui/nahuales/7 noj.jpg','SABIDUR├ìA, ES EL D├ìA DEL CONOCIMIENTO Y LA INTELEGNECIA, EL D├ìA DE LA CIENCIA.','Es el Nawal de la inteligencia, d├¡a dedicado a pedir la sabidur├¡a, el talento, el buen pensamiento. Es el Nawal del temblor o sismo. Personas muy creativas e imaginativas.'),(8,'Tijax ÔÇô Piedra','0001-01-01','0001-01-01','./src/gui/nahuales/8 tijax.jpg','CUCHILLO DE DOBLE FILO, EL D├ìA QUE CORTA TODO LO NEGATIVO.','Nawal de la muerte repentina y los sufrimientos. D├¡a propicio para curanderos y autoridades,  para cortar males y enfermedades. Personas confrontativas que cortan toda clase de males y problemas.'),(9,'Kawoq ÔÇô Rel├ímpago','0001-01-01','0001-01-01','./src/gui/nahuales/9 kawoq.jpg','RAYO DIVINO, EL D├ìA DE LA ABUNDANCIA PARA LA FAMILIA.','Es el Nawal de toda clase de pleitos, es el d├¡a de la mujer,  d├¡a para curar enfermedades. Nawal de la piedra de cuarzo y de las semillas de Tz┬┤it├®. Personas creativas, defensoras de la mujer.'),(10,'Ajpu ÔÇô Luz','0001-01-01','0001-01-01','./src/gui/nahuales/10 ajpu.jpg','GUERRERO, ES EL D├ìA DEL GRAN AJAW, EL D├ìA DEL SE├æOR, EL D├ìA DEL L├ìDER.','Es el Nawal de sol, d├¡a para pedir sabidur├¡a, talento y fortaleza f├¡sica. Nawal de las flores, la  m├║sica, el deporte,  los cazadores y la agricultura. Personas l├¡deres, selectivas, buscan primero su beneficio.'),(11,'Imox ÔÇô Pez','0001-01-01','0001-01-01','./src/gui/nahuales/11 imox.jpg','IZQUIERDA, ES EL D├ìA DEL AGUA, DEL CAMBIO Y DEL PODER ESP├ìRITUAL SOBRENATURAL.','Es el Nawal del mar, r├¡os y lagos, d├¡a para sanar enfermedades de la mente, para agradecer y pedir la lluvia, enfermedades de la mente. El Nawal de todos los lugares donde est├í el agua. No es el concepto de locura que conocemos com├║nmente,  es la capacidad de sentir lo que otros no sienten, por eso dicen que  hablan locuras.'),(12,'Iq\' - Viento','0001-01-01','0001-01-01','./src/gui/nahuales/12 iq.jpg','LUNA EL D├ìA DEL AIRE CRISTALINO Y DEL OX├ìGENO.','Es el Nawal del aire y la luna, del esp├¡ritu del ser humano. D├¡a para alejar energ├¡as malas y enfermedades. Es el viento que limpia nuestra casa y nuestro cuerpo. Personas nobles que se involucran en los problemas de otros f├ícilmente. Van y vienen de un lugar a otro, como el viento.'),(13,'Aq\'ab\'al - Amanecer','0001-01-01','0001-01-01','./src/gui/nahuales/13 aqabal.jpg','D├ìA Y NOCHE, EL D├ìA DEL KIEB┬┤AWIL (POLARIDAD), EL D├ìA DE LA BENDICI├ôN.','Es el Nawal de la claridad, d├¡a para pedir que salga la luz en todas las cosas. El d├¡a de las personas que componen los huesos de los enfermos y de los curanderos con plantas. Personas que cumplen sus compromisos.'),(14,'K\'at - Red','0001-01-01','0001-01-01','./src/gui/nahuales/14 kat.jpg','RED, EL DIA DE AGRUPAR, EL DIA DE REUNIR EN ABUNDANCIA.','Es el Nawal de las c├írceles visibles e invisibles. Es guardador. Representa la red donde se guarda el  ma├¡z y donde se atrapan los peces. D├¡a para pedir por los que est├ín presos, para enredar y desenredar las cosas. Personas con mucho fuego en su ser.  Manejan energ├¡as positivas y negativas.'),(15,'Kan ÔÇô Movimiento','0001-01-01','0001-01-01','./src/gui/nahuales/15 kan.jpg','SERPIENTE Y QUETZAL, EL D├ìA DE NUESTRA GALAXIA, LA VITALIDAD Y DEL FUEGO INTERNO.','Significa serpiente emplumada. Es el Nawal de la creaci├│n del hombre y la mujer. Es el due├▒o de todas las cosas materiales.  D├¡a para pedir soluci├│n a toda clase de problemas y necesidades. Personas con un alto sentido de la lealtad.'),(16,'Kame ÔÇô Tecolote','0001-01-01','0001-01-01','./src/gui/nahuales/16 kame.jpg','NACER Y MORIR, EL D├ìA DE LOS CICLOS DE LA VIDA Y LA GENETICA.','Es el Nawal de toda clase de muertes, d├¡a para pedir que se aleje la muerte. Se pide el descanso y  paz de un moribundo. La Muerte no es mala,  es el complemento de la vida, el descanso. Es el d├¡a para retirar energ├¡as negativas en las personas. Personas con habilidad para las artes y oficios.'),(17,'Kej ÔÇô Venado','0001-01-01','0001-01-01','./src/gui/nahuales/17 kej.jpg','VENADO, EL D├ìA DE LOS 4 PUNTOS CARDINALES, EL D├ìA DEL BALANCE.','Es el nawal de toda clase de animales cuadr├║pedos. D├¡a para pedir fuerza para cargar con nuestras penas. Nawal de las cuatro esquinas del mundo. D├¡a de los Ajq├¡jab┬┤ o sacerdotes mayas. Personas l├¡deres, dominantes con su pareja, les gusta la fama.'),(18,'Q\'anil ÔÇô Semilla','0001-01-01','0001-01-01','./src/gui/nahuales/18 qanil.jpg','SEMILLA, EL D├ìA DE LA SEMILLA DE LA VIDA Y LOS FRUTOS.','Es el Nawal de toda clase de semillas animales y vegetales. D├¡a de la fertilidad y las cosechas,  propicio para iniciar cualquier siembra o negocio. Significa los cuatro colores del ma├¡z,  rojo, negro, blanco y amarillo. Personas de mano ┬¿caliente┬¿ a quienes todo lo que siembran les florece.'),(19,'Toj ÔÇô Ofrenda','0001-01-01','0001-01-01','./src/gui/nahuales/19 toj.jpg','PAGO, EL D├ìA DE LOS PAGAMIENTOS Y LA LIBERACI├ôN DEL PASADO.','Es el Nawal de los cuatro se├▒ores del fuego,  Tojil, Awilix, Jakawitz┬┤ y  Nikajtakaj. D├¡a propicio para nivelar o pagar cualquier deuda. D├¡a en que se agradece todo lo que recibimos en nuestra vida,  lo bueno y lo malo. Personas con mucha sensibilidad para las artes y que lloran con facilidad'),(20,'Tz\'i\' ÔÇô Tepezcuintle','0001-01-01','0001-01-01','./src/gui/nahuales/20 tzi.jpg','PERRO, EL D├ìA DE LA JUSTICIA, EL D├ìA DEL EQUILIBRIO DE LA LEY MATERIAL Y ESPIRITUAL.','Es el Nawal de la justicia, la autoridad material y espiritual, el orden. D├¡a para pedir la soluci├│n a los problemas ante los tribunales. D├¡a para  alejar los vicios. Son las personas que hablan por otros.  Los due├▒os de las leyes. Juzgan a los dem├ís.');
